import React from 'react';
import ReactDOM from 'react-dom';

export default function PriceAndInfoSideDiv(props) {
        return (
            <div class="divPrice z-depth-5">
                Price: <br />
                {props.eth/props.fesb} ETH/FESB <br />
                10 FESB/ETH <br /><br />

                Pool info:<br />
                {props.fesb} FESB <br />
                {props.eth} ETH
            </div>
        );
    }
